import React, {Component} from 'react';

class AddPlayerForm extends Component {
    render(){
        return(
            <form>
                <input 
                    type= "text"
                    placeholder= "Enter a player's name"
                />
                <input 
                    type= "submit"
                    value= "Add player"
                />
            </form>
        );
    }

}

export default AddPlayerForm;
